import React from "react";


class Botones extends React.Component {
    render(){
        return(
            <div>
               <button onClick={() => alert('Mi aler  de Henrry ')}>Modulo 1</button>
               <button onClick={() => alert('Tu mensaje')}>Modulo 2</button>
            </div>
        );
    }
}

export default Botones;
